CREATE TABLE SGDTEST.PPD_DOCUMENTO
(
    IDE_PPD_DOCUMENTO NUMBER(18) PRIMARY KEY NOT NULL,
    COD_TIPO_DOC VARCHAR2(8),
    FEC_DOCUMENTO TIMESTAMP(6) NOT NULL,
    ASUNTO VARCHAR2(500 char) NOT NULL,
    NRO_FOLIOS NUMBER(18),
    NRO_ANEXOS NUMBER(18),
    COD_EST_DOC VARCHAR2(8),
    FEC_CREACION TIMESTAMP(6) NOT NULL,
    IDE_ECM VARCHAR2(50),
    COD_TIPO_SOPORTE VARCHAR2(8),
    COD_EST_ARCHIVADO VARCHAR2(8),
    IDE_DOCUMENTO NUMBER(18)
);
